// src/components/FolderList.js
import React from 'react';

const FolderList = ({ folders, onSelect }) => {
  return (
    <div>
      <h2>Folder List</h2>
      <ul>
        {folders
          .filter(folder => !folder.hasChildren) // Filter folder tanpa child
          .map(folder => (
            <li key={folder.id} onClick={() => onSelect(folder)}>
              {folder.name}
            </li>
          ))}
      </ul>
    </div>
  );
};

export default FolderList;
